    "남자 코트 추천",
    "남자 상의 추천",
    "남자 바지 추천",
  ]);
  return (
    <div className="App">
      <div className="black-nav">
        <h2>{posts}</h2>
      </div>
      <div className="list">
        <h4>{title[0]}</h4>
        <p>2월 17일 발행</p>
      </div>
      <div className="list">
        <h4>{title[1]}</h4>
        <p>2월 17일 발행</p>
      </div>
      <div className="list">
        <h4>{title[2]}</h4>
        <p>2월 17일 발행</p>
      </div>
    </div>
  );
}

export default App;
